import { Box, IconButton } from '@mui/material'
import React from 'react'
import StarBorderOutlinedIcon from "@mui/icons-material/StarBorderOutlined"

function Memo() {
    return (
        <>
            <Box sx={{
                display: "flex",
                alignItems: "center",
                justifyContent: "space-between",
                width: "100%"
            }}>
                <IconButton>
                    <StarBorderOutlinedIcon />
                </IconButton>
            </Box>
        </>
    )
}

export default Memo
